SET FOREIGN_KEY_CHECKS=0;
START TRANSACTION;
CREATE TABLE countries (
    id INT PRIMARY KEY AUTO_INCREMENT,
    iso2 VARCHAR(255),
    iso3 VARCHAR(255),
    name VARCHAR(255)
);
CREATE TABLE cities (
    id INT PRIMARY KEY AUTO_INCREMENT,
    country_id INTEGER,
    name VARCHAR(255),
    FOREIGN KEY (country_id) REFERENCES countries (id)
);
